@cecewinans incomparable vocals and picture-perfect smile have graced music stages across the world for more than four decades. Aspiring gospel music artists with dreams of crossing over and achieving mainstream success look to Winans as the standard for making that transition. This year at the 38th annual Stellar Gospel Music Awards, Winans was honored with the Aretha Franklin Icon Award, a fitting tribute to her inspirational music, impressive vocals and ability to influence listeners.
